import React, { useState } from "react";
import PageTwo from "../component1/PageTwo";

const Form = (props) => {
  const [view, setView] = useState("");

  const handleView = () => {
    setView(props.name);
  };

  return (
    <div>
      <form onSubmit={props.handleSubmit}>
        <div className="search">
          <div className="container">
            <label htmlFor="">where you'd like to go</label>
            <br />

            <input
              type="text"
              placeholder="      Location..."
              className="input"
              value={props.name}
              onChange={props.handleNewDestination}
            />
          </div>
        </div>
        <div className="search">
          <div className="container">
            <label htmlFor="">Check in </label>
            <input
              type="date"
              className="CheckIn"
              value={props.checkIn}
              onChange={props.handleNewcCheckIn}
            />
          </div>
        </div>
        <div className="search">
          <div className="container">
            <label htmlFor="">Check out</label>
            <input
              type="date"
              className="CheckIn"
              value={props.checkOut}
              onChange={props.handleNewCheckOut}
            />
          </div>
          <button className="CheckIn" type="submit">
            Add to wishlist
          </button>
          <button onClick={handleView}>View</button>
        </div>
      </form>
      <PageTwo handleView={handleView} />
    </div>
  );
};

export default Form;
